function capitalize(e){return e.charAt(0).toUpperCase()+e.slice(1)}function drawChart(e,t){const i=Object.keys(t),a=i.map(e=>[capitalize(e),t[e][0]]),o=google.visualization.arrayToDataTable([["Task","Cucumber Results"]].concat(a)),c=i.reduce((e,i)=>e+t[i][0],0),r={width:"100%",height:240,title:c+" "+(1===c?e.slice(0,-1):e),is3D:!0,tooltip:{trigger:"selection"},colors:i.map(e=>t[e][1]),fontSize:"13",fontName:'"Helvetica Neue", "Helvetica", Helvetica, Arial, sans-serif',titleTextStyle:{fontSize:"13",color:"#5e5e5e"}};new google.visualization.PieChart(document.getElementById(e.toLowerCase()+"Chart")).draw(o,r)}$(document).ready(()=>{$(".img-open img").click(e=>{const t=new Image;t.src=e.target.src,t.style="width: 100%",window.open("").document.write(t.outerHTML)})});
